e.exports='---changelog---\ndate: "2022-06-06"\nlocale: "en-US"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nNew Features {added marginTop}\n======================\n\n* **Introducing text chat*but in voice channels.*** Voice channels now have embedded chat thats specific to each voice channel. Peep general, is a thing of the past. \n* **But how exactly do they work?** Hows this different from regular text channels? They pop out, theyre unique to a voice channel, and if you wanna learn more, [I gotchu.](https://support.discord.com/hc/articles/4412085582359)\n* **Account switcher is here.** People with multiple accounts can now easily switch between them without needing to log in and out each time. Click on your avatar in the bottom left to get started. [And before you message us asking how this works, we kindly ask you read the FAQ, and then send your question in, which is probably in the FAQ, but you struggle with remembering things. Me too, thats ok.](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **New command permissions page for bots and apps.** Customize which roles can use specific slash commands and in which channels under Server Settings > Integrations.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "nl"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nNieuwe functies {added marginTop}\n======================\n\n* **We introduceren tekstchat* maar dan op spraakkanalen.*** Spraakkanalen bevatten nu een ingesloten chat voor elk afzonderlijk kanaal. Overal even gluren behoort tot het verleden. \n* **"Maar hoe werkt dat dan precies?** Wat is het verschil met gewone tekstkanalen? Ze zijn losgekoppeld en horen maar bij n spraakkanaal. Wil je meer weten? [Komt ie.](https://support.discord.com/hc/articles/4412085582359)\n* **De accountschakelaar is gearriveerd.** Als je meerdere accounts hebt, kun je nu makkelijker schakelen tussen accounts zonder elke keer in en uit te hoeven loggen. Klik op je avatar linksonder om te beginnen. [Neem eerst de FAQ door voor je een vraag aan ons stelt. Waarschijnlijk staat het antwoord dan alsnog in de FAQ, maar goed. Ik ben zelf ook niet goed in zoeken.](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **Nieuwe pagina over opdrachtmachtigingen voor bots en apps.** Bepaal welke rollen specifieke slashopdrachten kunnen gebruiken  en in welke kanalen  via Serverinstellingen > Integraties.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "fr"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nNouvelles fonctionnalits {added marginTop}\n======================\n\n* **Le chat textuel dbarque...*dans les salons vocaux.*** Les salons vocaux ont maintenant un chat intgr spcifique  chaque salon vocal. Blabla du salon gnral, c\'est du pass. \n* **Mais comment a marche exactement?** En quoi ils sont diffrents des salons textuels normaux? Les chats textuels peuvent s\'ouvrir dans une fentre, et ils sont propres  chaque salon vocal. Si tu veux en savoir plus, [pas de stress.](https://support.discord.com/hc/articles/4412085582359)\n* **La fonctionnalit de changement de compte est arrive.** Les personnes possdant plusieurs comptes peuvent dsormais alterner entre ces derniers sans devoir se connecter et se dconnecter  chaque fois. Clique sur ton avatar en bas  gauche pour essayer. [Et avant de nous crire pour nous demander comment a fonctionne, nous te remercions de bien vouloir lire notre FAQ, puis de nous envoyer ensuite ta question, dont la rponse est probablement dj dans la FAQ... Mais bon, personne n\'est  l\'abri d\'un petit trou de mmoire. Ne t\'en fais pas, a nous arrive aussi.](https://support.discord.com/hc/fr/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **Une nouvelle page de permissions de commandes pour les bots et les applications.** Personnalise les rles qui peuvent utiliser des commandes slash spcifiques et pour quels salons dans Paramtres du serveur > Intgrations.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "de"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nNeue Features {added marginTop}\n======================\n\n* **Wir stellen vor: Textchat... *in Sprachkanlen.*** Jeder Sprachkanal hat jetzt einen eigenen, eingebetteten Textchat. Das berschwemmen vom allgemeinen Chat mit unzusammenhngenden Gesprchsfetzen gehrt ab sofort der Vergangenheit an. \n* **Aber wie funktionieren die genau?** Und was ist der Unterschied zu normalen Textkanlen? Es sind Popouts, die jeweils zu einem einzigen Sprachkanal gehren. Wenn du mehr erfahren willst, [guck mal hier.](https://support.discord.com/hc/articles/4412085582359)\n* **Zwischen Accounts wechseln.** Benutzer mit mehreren Accounts knnen jetzt ganz einfach zwischen ihnen wechseln, ohne sich jedes Mal ein- oder ausloggen zu mssen. Klicke dafr einfach unten links auf deinen Avatar. [Und bevor du uns jetzt anschreibst, um zu fragen, wie das geht, bitten wir dich darum, erst die FAQ zu lesen und uns dann deine Frage zu schicken, die vermutlich in den FAQ steht, aber du kannst dir Sachen halt einfach schlecht merken. Ist okay, geht mir genauso.](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ) \n* **Fr Bots und Apps gibt es jetzt eine neue Berechtigungen fr Befehle-Seite.** Passe unter Servereinstellungen > Integrationen an, welche Rollen in welchen Kanlen welche Slash-Befehle verwenden knnen.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "it"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nNuove funzionalit {added marginTop}\n======================\n\n* **Ti presentiamo la chat testuale... *ma nei canali vocali.*** Ogni canale vocale ora ha integrata la propria chat testuale. Addio chat generiche. \n* **"Ma come funziona?** Cosa la rende diversa dai normali canali testuali?" Si apre in una nuova finestra ed  specifica per un determinato canale vocale. E se vuoi scoprire di pi, [ci penso io.](https://support.discord.com/hc/articles/4412085582359)\n* ** arrivato il cambio di account.** Ora le persone con pi account possono passare facilmente dall\'uno all\'altro senza dover accedere e disconnettersi ogni volta. Clicca sul tuo avatar in basso a sinistra per iniziare. [E prima di contattarci per chiederci come funziona, ti invitiamo a leggere le FAQ e poi a inviarci la tua domanda, che probabilmente  gi contenuta nelle FAQ, ma a volte  difficile ricordarsi tutto. Capita anche a me, non preoccuparti.](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **Nuova pagina dei permessi per i comandi per bot e app.** Personalizza quali ruoli possono usare comandi slash specifici e in quali canali su Impostazioni del server > Integrazioni.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "ja"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\n {added marginTop}\n======================\n\n* ****** \n* ****[](https://support.discord.com/hc/articles/4412085582359)\n* ****[ FAQ FAQ ](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ) \n* **Bot **>\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "ko"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\n  {added marginTop}\n======================\n\n* ** ...   .***       . " "   . \n* **" ?**     ?"      .   [](https://support.discord.com/hc/articles/4412085582359) .\n* **   .**           .     . [      ,      .         ,          .  .  .](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ) \n* **       .**    ,         >  .\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "pl"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nNowe funkcje {added marginTop}\n======================\n\n* **Przedstawiamy czat tekstowy*ale na kanaach gosowych.*** Teraz kady kana gosowy ma wbudowany czat. Spamowanie czatu oglnego to melodia przeszoci. \n* **Ale jak to dokadnie dziaa?** Czym rni si taki czat od zwykego kanau tekstowego? Jest otwierany w nowym oknie i powizany z danym kanaem gosowym. Chcesz wiedzie wicej? [Nie ma sprawy.](https://support.discord.com/hc/articles/4412085582359)\n* **Nadesza opcja przeczania kont.** Uytkownicy z wieloma kontami mog teraz atwo przecza si midzy nimi bez potrzeby kadorazowego wylogowania i logowania. Kliknij swj awatar w lewym dolnym rogu, aby zacz. [Prosimy o przeczytanie najczciej zadawanych pyta, zanim wylesz do nas pytanie na temat dziaania tej funkcji, ktre zreszt pewnie znajduje si ju w sekcji najczciej zadawanych pyta, ale masz problemy z pamici. Spokojnie, ja te.](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **Nowa strona uprawnie dot. polece dla botw i aplikacji.** Okrel, ktre role mog uywa okrelonych polece z ukonikiem i na jakich kanaach, w menu Ustawienia serwera > Integracje.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "pt-BR"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nNovos recursos {added marginTop}\n======================\n\n* **Apresentando o bate-papo por texto... *s que nos canais de voz.*** Canais de voz agora tem um bate-papo integrado que  especfico de cada canal de voz. "Olha no geral"  coisa do passado. \n* **"Mas como eles funcionam?** Qual a diferena do canal de texto normal?" Eles so pop out, so especficos de cada canal de voz, e se quiser saber mais, [l vai. ](https://support.discord.com/hc/articles/4412085582359)\n* **A troca de contas chegou.** Pessoas com vrias contas agora podem trocar entre elas facilmente sem precisar sair e entrar de cada uma toda vez. Clique no seu avatar no canto inferior direito. [E antes que voc nos mande uma mensagem perguntando como isso funciona, pedimos que leia as Perguntas Frequentes, e ento envie suas dvidas, que provavelmente esto nas Perguntas Frequentes, mas voc tem problemas de memria. Tudo bem, eu tambm tenho.](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **Nova pgina de permisses de comando para bots e apps.** Personalize quais cargos podem usar comandos de barra e em quais canais em Configuraes do Servidor > Integraes.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "ru"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\n  {added marginTop}\n======================\n\n* **   *  .***         .      ! \n* **     ?**       ?.            .     , [ ](https://support.discord.com/hc/articles/4412085582359).\n* **   .** ,      ,      .            !  ,         . [        ,    , ,            ,              .  ,   .](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **          .**    ,       -,         > .\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "es-ES"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nNuevas caractersticas {added marginTop}\n======================\n\n* **Presentamos el chat de texto... pero en los canales de voz.*** Cada canal de voz tiene ahora incorporado un chat especfico. Lo he pasado al canal general ser cosa del pasado. \n* **Pero cmo funcionan exactamente?** Y en qu se diferencian respecto de los canales de texto de siempre? Saldrn en una ventana emergente, son exclusivos para cada canal de voz y, si quieres saber ms, [aqu lo tienes todo.](https://support.discord.com/hc/articles/4412085582359)\n* **El cambio de cuentas ha llegado.** Ahora, la gente que tenga varias cuentas podr pasar de una a otra fcilmente sin tener que cerrar e iniciar sesin cada vez. Para empezar, haz clic en tu avatar abajo a la izquierda. [Antes de que nos escribas porque no entiendes cmo funciona, te pedimos por favor que leas la seccin de preguntas frecuentes y luego nos escribas. Es probable que tu consulta est respondida en las preguntas frecuentes y no lo recuerdes. A m tambin me pasa. No pasa nada.](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **Hay una nueva pgina de permisos de comando para bots y aplicaciones.** En Ajustes del servidor > Integraciones puedes personalizar los comandos de barra diagonal que puede usar cada rol y en qu canales.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "sv-SE"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nNya funktioner {added marginTop}\n======================\n\n* **Vi presenterar textchatt *fast i rstkanaler.*** Rstkanalerna har nu en inbddad chatt som r specifik fr varje rstkanal. Att smygtitta tillhr det frgngna. \n* **Men exakt hur fungerar de?** Hur skiljer sig detta frn vanliga textkanaler? De poppar ut, de r unika fr en rstkanal. Vill du lra dig mer? [Det fixar jag.](https://support.discord.com/hc/articles/4412085582359)\n* **Kontovxlaren r hr.** De som har flera konton kan nu enkelt vxla mellan dem utan att behva logga in och ut varje gng. Klicka p din avatar lngst ner till vnster fr att komma igng. [Och innan du skriver och frgar om hur det hr funkar, ber vi dig vnligen att lsa Vanliga frgor och drefter skicka in din frga. Den finns skert nd i Vanliga frgor, men du har svrt att komma ihg saker. Det har jag med, det r okej.](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **Ny kommandobehrighetssida fr bottar och appar.** Stll in vilka roller som kan anvnda specifika snedstreckskommandon och i vilka kanaler i Serverinstllningar > Integrationer.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "tr"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\nYeni zellikler {added marginTop}\n======================\n\n* **Karnda yazl sohbet... *ama ses kanallarnda.*** Ses kanallarnda artk her bir kanala zel yerleik sohbet bulunuyor. \\"Genele attm\\" demek mazide kald. \n* **\\"Peki tam olarak nasl alyor?** Normal metin kanalndan fark ne?\\" Pencerede alabiliyor ve her ses kanalnn kendine zel metin kanal bulunuyor. Daha fazla bilgi edinmek istiyorsan [merakn buradan giderebilirsin.](https://support.discord.com/hc/articles/4412085582359)\n* **Hesaplar aras gei geldi.** Birden fazla hesab olanlar artk her seferinde giri yapmalarna gerek kalmadan hesaplar arasnda kolaylkla gei yapabilir. Balamak iin sol alt kedeki avatarna tkla. [Bu zelliin nasl altn bize sormadan nce ltfen SSS yazmza gz at. Sorunun cevabn byk ihtimalle SSS yazmzda bulabilirsin. Sonradan unutmu olabilirsin tabii. Sorun deil, ben de unutuyorum.](https://support.discord.com/hc/tr/articles/4412732047127-Discord-Account-Switcher-FAQ)\n* **Botlar ve uygulamalar iin yeni komut izinleri sayfas.** Hangi rollerin, hangi kanallarda, hangi eik izgi komutlarn kullanabileceini Sunucu Ayarlar > Entegrasyonlar ksmndan zelletirebilirsin.\n\n\n---changelog---\ndate: "2022-06-06"\nlocale: "zh-CN"\nrevision: 1\nyoutube_video_id: "IlEAb60EYWU"\n---\n {added marginTop}\n======================\n\n* ****** \n* ****[](https://support.discord.com/hc/articles/4412085582359)\n* ****[](https://support.discord.com/hc/en-us/articles/4412732047127-Discord-Account-Switcher-FAQ) \n* **** > \n\n\n'
